import React from "react";

const Projects = ({ data }) => {
  if (data) {
    var projects = data.map((project)=>{
      return (
        <section className="project">
          <div className="projectTitle">
            <h1>{project.title}</h1>
            <img src={project.img} alt="project thumbnail"/>
          </div>
          <div className="projectInfo">
              <button><a href={project.url}>Project Link</a></button>
              <a href={project.url}><button>Github Code</button></a>
              <p>Tech Stack/Skills Used</p>

          </div>
        </section>
      )
    })
  }

  return (
    <section id="projects">
      {projects}
    </section>
  );
};

export default Projects;
